# The security config file
#
# All files in this Secret replace defaults in
# /usr/share/opensearch/config/opensearch-security.
# Any file not present here will use the default version,
# which includes demo users and passwords.
#
# WARNING: BE VERY CAREFUL WITH THESE FILES
# If the syntax is wrong, OpenSearch Dashboards will not start,
# and it won't fucking tell you why.
# In the bootstrap container you'll get logs like:
#   Will not attempt to create index .opendistro_security and default configs if they are absent. Use securityadmin to initialize cluster
# and
#   Not yet initialized (you may need to run securityadmin)
# IF YOU SEE THOSE, THIS FILE IS PROBABLY WRONG.
# (Try yamllint against it.)
#
# It contains the 'authenticator' username and password for the LDAP server.
# If that password ever changes, this file must be updated
# and all the OpenSearch pods restarted.
#
# TODOs for this file go **HERE**, not inline, so that they can be grep'd even though this file is encrypted with SOPS:
# - TODO: Get proxy authentication working
# - TODO: Lock down X-Forwarded-For headers, which currently accept any proxy
# - TODO: Delete roles-default-NOTUSED-JUSTFOREXAMPLES.yml
